import docketService from "../services/docket.service";

export const submitChoices = (payload) => dispatch => {

    return docketService
        .getInfoByDocketNumber(payload)
        .then(response => {
            let dispatchedPayload = {};
            if('caseMeta' in response.data){
                dispatchedPayload = {
                    data:response.data,
                    status:"success"
                } 
            }else{
                dispatchedPayload = {
                    status:"error"
                }; 
            }

            dispatch({
                type:'GET_DOCKET_SUCCESS',
                payload:dispatchedPayload
            });

            return Promise.resolve(dispatchedPayload);
        })
        .catch(err => {
          console.log(err);
            return Promise.resolve(false);
        })
}
